const themePresets = [
  // ðŸ”† Bright Yellow tones
  { value: 'theme-yellow-dark', label: 'Golden Eclipse', accent: '#F2B01E', text: '#FFF7B0' },
  { value: 'theme-yellow',      label: 'Golden Ember',   accent: '#F2B01E', text: '#2C2C2C' },

  // ðŸŒ¹ Romantic & Warm
  { value: 'theme-rose',        label: 'Crimson Rose',    accent: '#F7374F', text: '#ffffff' },
  { value: 'theme-rosewood',    label: 'Rosewood Velvet', accent: '#A53860', text: '#FFF3F7' },
  { value: 'theme-ember',       label: 'Amber Ember',     accent: '#F29F58', text: '#FFF9F0' },
  { value: 'theme-inferno',     label: 'Inferno Burst',   accent: '#FFA900', text: '#FFF2E5' },
  { value: 'theme-crimson',     label: 'Crimson Blaze',   accent: '#FF204E', text: '#FDECEC' },

  // ðŸ’œ Deep Purples & Violets
  { value: 'theme-violet',      label: 'Royal Violet',    accent: '#910A67', text: '#f4f0ff' },
  { value: 'theme-plum',        label: 'Mulberry Mist',   accent: '#A64D79', text: '#f7ecf4' },
  { value: 'theme-amethyst',    label: 'Amethyst Dream',  accent: '#E45A92', text: '#FFF5F9' },

  // ðŸŒ¿ Earthy & Natural
  { value: 'theme-olive',       label: 'Verdant Olive',   accent: '#E3DE61', text: '#f7fff8' },
  { value: 'theme-forest',      label: 'Emerald Forest',  accent: '#2ECC71', text: '#e9fff1' },
  { value: 'theme-mint',        label: 'Coral Mint',      accent: '#E84A5F', text: '#0b0f12' },

  // ðŸŒŠ Cool & Oceanic
  { value: 'theme-ocean',       label: 'Deep Ocean',      accent: '#23A6F2', text: '#e7f6ff' },
  { value: 'theme-slate',       label: 'Midnight Slate',  accent: '#7AA2F7', text: '#f1f5f9' },

  // ðŸŒ… Warm & Vibrant
  { value: 'theme-sunset',      label: 'Amber Dusk',      accent: '#FF7A59', text: '#fff4ee' },
  { value: 'theme-vibrant',     label: 'Vibrant Warm',    accent: '#EF3D59', text: '#061016' },
  { value: 'theme-blush',       label: 'Blush Tide',      accent: '#F18C8E', text: '#10222b' },
];

export default themePresets;
